instruction:
Write a function `fillObj` that takes an object and three values:
* `obj` - object
* `value1` - value,
* `value2` - value,
* `value3` - value

Add the following keys to the object:
* `width` with value `value1`,
* `height` with value `value2`,
* `length` with value `value3`.

If the object already has one of these keys, leave it unchanged.

The function should return the object.

An example of running the function:
```javascript
fillObj({}, 10, 20, 30); // { width: 10, height: 20, length: 30 }
fillObj({ width: 10 }, 20, 30, 40); // { width: 10, height: 30, length: 40 }
fillObj({ width: 10, height: 20 }, 20, 30, 40); // { width: 10, height: 20, length: 40 }
```
A similar example:
```javascript
function fillCarObj(car, "red", "Camry", 2020) {
if (!car.color) car.color = "red";
if (!car.model) car.model = "Camry";
if (!car.year) car.year = 2020;
return car;
}
```
